const initialState = {
    basket: {
        id: 0,
    },
}

export default function BasketReducer(state = initialState, action: { type: any; }) {
    switch (action.type) {

        case 'ADD_TO_BASKET':
            return {
                ...state,
                basket: { ...state, action, },
            }

        default:
            return state;
    }
}
